(6, STRINGDECODE('\ud83d\udde3 _\u041f\u0430\u043c\u044f\u0442\u043a\u0430 \u043a \u043a\u0430\u0436\u0434\u043e\u043c\u0443 \u043f\u0443\u043d\u043a\u0442\u0443:_\n\n1. \u041a\u0430\u0436\u0434\u044b\u0439 \u0434\u0435\u043d\u044c *\u043c\u0438\u043d\u0438\u043c\u0443\u043c* \u043f\u043e *20 \u043f\u0440\u0438\u0441\u0435\u0434\u0430\u043d\u0438\u0439 \u0438 20 \u043e\u0442\u0436\u0438\u043c\u0430\u043d\u0438\u0439*\ud83c\udfcb\ud83c\udffd\n2. \u041b\u044e\u0431\u043e\u0439 \u043a\u043d\u0438\u0433\u0438 \u043f\u043e \u0441\u0432\u043e\u0435\u043c\u0443 \u0443\u0441\u043c\u043e\u0442\u0440\u0435\u043d\u0438\u044e *(100 \u0441\u0442\u0440. \u043a\u043d\u0438\u0433\u0438/\u043d\u0435\u0434.)*\ud83d\udcda\n3. *3 \u0437\u0432\u043e\u043d\u043a\u0430* \u0434\u0440\u0443\u0433\u0443/\u0440\u043e\u0434\u0441\u0442\u0432\u0435\u043d\u043d\u0438\u043a\u0443, \u0441 \u043a\u0435\u043c \u0434\u0430\u0432\u043d\u043e \u043d\u0435 \u0440\u0430\u0437\u0433\u043e\u0432\u0430\u0440\u0438\u0432\u0430\u043b (\u043c\u0438\u043d\u0438\u043c\u0443\u043c 3\ud83d\udcde/\u043d\u0435\u0434)\u260e\n4. \u0410\u043a\u0442\u0438\u0432\u043d\u043e\u0435 \u0432\u0440\u0435\u043c\u044f\u043f\u0440\u0435\u043f\u0440\u043e\u0432\u043e\u0436\u0434\u0435\u043d\u0438\u0435 \u0441 \u0434\u0435\u0442\u044c\u043c\u0438/\u0441\u0443\u043f\u0440\u0443\u0433\u043e\u0439 *(\u043c\u0438\u043d\u0438\u043c\u0443\u043c 2 \u0447/\u043d\u0435\u0434)*\ud83d\udc68\ud83d\udc69\ud83d\udc67\ud83d\udc66\n5. \u0412\u0441\u0442\u0440\u0435\u0447\u0430 \u0441 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u043e\u043c, \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0441\u0447\u0438\u0442\u0430\u0435\u0442\u0435 \u043f\u0440\u043e\u0434\u0432\u0438\u043d\u0443\u0442\u044b\u043c, \u0443\u0441\u043f\u0435\u0448\u043d\u044b\u043c \u0438 \u043f\u043e\u043b\u0435\u0437\u043d\u044b\u043c \u0434\u043b\u044f \u0432\u0430\u0448\u0435\u0433\u043e \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f *(1 \u0432\u0441\u0442\u0440/\u043d\u0435\u0434)*\ud83d\udc65\ud83d\udc54\n6.\u0421\u043f\u043e\u0440\u0442\u0438\u0432\u043d\u043e\u0435 \u0432\u0440\u0435\u043c\u044f\u043f\u0440\u0435\u043f\u0440\u043e\u0432\u043e\u0436\u0434\u0435\u043d\u0438\u0435 (BJJ, \u0424\u0443\u0442\u0431\u043e\u043b, \u0412\u043e\u043b\u0435\u0439\u0431\u043e\u043b, \u0438\u0442\u043f)\ud83c\udfd0\u26bd\u26f9\ud83c\udfff\ud83d\udeb4\ud83c\udffc\ud83c\udfcb\ud83c\udffc\u2640\ud83c\udfca\ud83c\udffd\n(\u041c\u0438\u043d\u0438\u043c\u0443\u043c 3 \u0440\u0430\u0437\u0430 \u0432 \u043d\u0435\u0434\u0435\u043b\u044c\u044e)\n\n_\u0412 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 \u043c\u0435\u0441\u044f\u0446\u0430  \u043f\u0438\u0448\u0435\u043c \u043f\u0440\u043e\u0433\u0440\u0435\u0441\u0441 \u043f\u043e \u043a\u0430\u0436\u0434\u043e\u043c\u0443 \u043f\u0443\u043d\u043a\u0442\u0443, \u0437\u0430 \u043d\u0430\u0438\u043c\u0435\u043d\u044c\u0448\u0435\u0435 \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435 \u043f\u0443\u043d\u043a\u0442\u043e\u0432  *\u043d\u0430\u043a\u0440\u044b\u0432\u0430\u0435\u0442 \u0434\u0430\u0441\u0442\u0430\u0440\u0445\u0430\u043d \u0434\u043e\u043c\u0430*_\n[19.02, 1:39] \u0415\u0440\u043c\u0435\u043a \u0411\u043e\u0434\u0438: 1. \u0416\u0430\u043a\u0441\u044b\u043b\u044b\u043a\n2. \u0410\u0434\u0438\u043b\u044c \n3. \u0410\u0441\u043b\u0430\u043d \n4. \u0411\u0435\u0440\u0438\u043a\n5. \u0410\u0441\u0435\u0442 \n6. \u041c\u0438\u0440\u0436\u0430\u043d\n7. \u0415\u0440\u043c\u0435\u043a'), NULL, 1);              
